export const Header = () => {
  return (
    <header className=" h-max relative">
      <div className="absolute top-0 right-0">
        <h2 className="cust-font">Save the date</h2>
        <p>00/00/00</p>
      </div>
      <div className="intro-img bg-headerBg w-full h-screen flex items-center justify-center p-5 bg-cover bg-center">
        <h1 className="cust-font text-9xl text-theme1">A day of joy</h1>
      </div>
    </header>
  );
};
